import Blob from 'cross-blob';

export interface SectorMap {
	sectors: number[],
	sizes : number[]
};

export function guess_sector_map(file_size : number) : SectorMap {
	if(file_size == 1902385152) return retail_map;
	if(file_size == 1902393344) return oct13_map;
	if(file_size == 156485632) return demo_map;
	throw new Error("Could not guess sector map based on file size - please input one manually");
}

async function compare_pattern(blob : Blob, location : number, pattern : number[]) : Promise<boolean> {
	let slice = new Uint8Array(await blob.slice(location, location + pattern.length).arrayBuffer());
	for(let i = 0; i < slice.length; i++) {
		if(pattern[i] != slice[i]) return false;
	}
	return true;
}

async function get_sector_map_location(executable_blob : Blob) : Promise<{location : number, size : number}> {
	if(await compare_pattern(executable_blob, 0xf4f4, [0x2d, 0x00, 0x07, 0x3c, 0x9a, 0x05, 0x08, 0x24, 0x18, 0x76, 0xe7, 0x24, 0xc8, 0xbc, 0xc6, 0x24])) {
		return {
			location: 0x1d7698,
			size: 1434
		};
	}
	throw new Error("Could not get sector map location for executable file");
}

export async function import_sector_map(executable_blob : Blob) : Promise<SectorMap> {
	let {location, size} = await get_sector_map_location(executable_blob);
	let dv = new DataView(await executable_blob.slice(location, location + size*8).arrayBuffer());
	let sectors = new Array<number>(size);
	let sizes = new Array<number>(size);
	for(let i = 0; i < size; i++) {
		sectors[i] = dv.getInt32(i*8, true);
		sizes[i] = dv.getInt32(i*8+4, true);
	}
	return {sectors, sizes}
}

export async function export_sector_map(executable_blob : Blob, sector_map : SectorMap) : Promise<Blob> {
	let {location, size} = await get_sector_map_location(executable_blob);
	if(size != sector_map.sectors.length) {
		throw new Error("Attempted to export sector map to executable with non-matching length (sector map has " + sector_map.sectors.length + " files, executable expects " + size + " files)");
	}
	let dv = new DataView(new ArrayBuffer(size*8));
	for(let i = 0; i < size; i++) {
		dv.setInt32(i*8, sector_map.sectors[i], true);
		dv.setInt32(i*8+4, sector_map.sizes[i], true);
	}
	return new Blob([
		executable_blob.slice(0, location),
		dv.buffer,
		executable_blob.slice(location + size*8, executable_blob.size)
	]);
}

